import React from "react";
import basket from "../assets/basket";

export default function Like({ like, closeCart, removeToCart }) {
  return (
    <div>
      <h2>Preferiti</h2>
      {like.map((item, index) => {
        <div className="products-shop" key={index}>
          <img className="cart-img" src={item.image_link} alt={item.name}></img>
          <h4>{item.name}</h4>
          <a className="remove-to-cart-btn" onClick={() => removeToCart(item)}>
            <img src={basket} alt="delete"></img>
          </a>
        </div>;
      })}
    </div>
  );
}
